import axios from 'axios'
import config1 from '../assets/config'
import config from '../../config'

export default async function (url) {
    try {
        const { data } = await axios.get({
            baseUrl: this.localApiUrl
        })
        return data
    } catch (error) {
        return error.response || { status: 404 }
    }
}
